          Remember this bots are high risk investments and Ninja Bot Trader will
          not be responsible for losses.
        </p>
        <div className="footer-top d-flex flex-wrap align-items-center justify-content-center gap-5 p-4 footer">
        <a
            className="footer-bsc floating-leve"
            target="_blank"
            href={""}
          >
            <img
              src="/assets/img/dapp.png"
              alt="Dapp Radar"
              className="footer-bottom-img bsc"
            />
          </a>
          <a
            target="_blank"
            className="floating-leve"
            href={links && links.shieldcrypto}
          >
            <img
              src="/assets/img/favicon_1.png"
